import React from "react";
import "./Privacy.css";

function Privacy() {
  return (
    <div>
      <h1 className="privacy-policy-main-heading">Privacy Policy</h1>
      <h3 className="privacy-policy-subheading">17 June 2025</h3>
      <p className="text">
        At <i>Our Travel</i>, we value and respect your privacy.
      </p>
    </div>
  );
}

export default Privacy;
